  return (
    <View style={styles.container}>
      <Text style={{color:'#fff'}}>Open up App.js to start working on your app!hehe</Text>
      <Image />
      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#25292e',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
